import { BrowserRouter, Route, Routes } from "react-router-dom";
import Parent from "./DashBoard/Parent";

function App() {
  return (
    <div>
         <BrowserRouter>
         <Routes>
          <Route path='/' element={<Parent/>}/>
         </Routes>
         </BrowserRouter>
    </div>
  );
}

export default App;
